insert into dodao.spaces (id, settings, verified, created_at, creator, updated_at, about, avatar, admins, categories, github, members, mission, network, terms, twitter, blockchain, skin, discord_invite, guides_page_footer_content, guides_page_header_content, guides_bundle_page_footer_content, guides_bundle_page_header_content, blog_site, public_forum_website, reference_docs_website, telegram_invite, features, invite_links) values ('babylon-finance-eth-1', '{"name": "Babylon Finance", "skin": "babylon", "about": "Babylon is a community-led asset management protocol that enables users to invest in DeFi together. It''s built on the Ethereum network and it''s non-custodial, transparent, permission-less, and governed by the community.\\n\\nBabylon has a two-layer governance system. The protocol is managed by the holders of the governance token, $BABL, which is used to vote on changes to the protocol and decide on the best use of the protocol treasury. \\n\\nBabylonians can create investment communities (called \\"Gardens\\") and invite people to deposit capital. Members participate in the garden by joining the telegram chat, suggesting investment Strategies and voting on Strategies. Members receive rewards based on their contributions.", "admins": ["0xd77763FF7Cd1f612335da095403ef7374Ff1a8E4", "0x10cCD4136471c7c266a9Fc4569622989Fb4caB99"], "avatar": "ipfs://Qmd9afE8uLtdfRAQwxMnWUmrG8kxRXm3P4bgU1KBqonA4n", "creator": "0x470579d16401a36BF63b1428eaA7189FBdE5Fee9", "members": [], "mission": "Babylon is a community-led asset management protocol that enables users to invest in DeFi together", "network": "1", "twitter": "BabylonFinance", "blockchain": "ETH", "categories": ["protocol", "investment"], "validation": {"name": "basic", "params": {}}}', 0, 1652238296, '0x470579d16401a36BF63b1428eaA7189FBdE5Fee9', 1652238296, 'Babylon is a community-led asset management protocol that enables users to invest in DeFi together. It''s built on the Ethereum network and it''s non-custodial, transparent, permission-less, and governed by the community.
