insert into dodao.spaces (id, settings, verified, created_at, creator, updated_at, about, avatar, admins, categories, github, members, mission, network, terms, twitter, blockchain, skin, discord_invite, guides_page_footer_content, guides_page_header_content, guides_bundle_page_footer_content, guides_bundle_page_header_content, blog_site, public_forum_website, reference_docs_website, telegram_invite, features, invite_links) values ('basic-dao-one-mainnet', '{"name": "Basic DAO", "skin": "dodao", "about": "As operations scale to support the initiatives of Harmony’s Core Team and Core DAOs, the need for a high-quality, diverse, and well-rounded team of contributors is paramount to the success of our ecosystem. \\n\\nIn Harmony’s decentralized network, characterized by an intrepid appetite for expansion, a robust operational infrastructure becomes a necessity to support our ecosystem’s growth. Additionally, a strong and diverse talent pool is needed to assist our Dev, Event, and Operations teams in scaling by reducing operational slippage. Too often, administrative and HR tasks are neglected in favor of mission-based and passion-oriented initiatives. In addition, managing relationships, communications, and high-level treasury and team management scales at a slower rate when compared to the growth of the ecosystem. Through scaling a team of contributors, BasicDAO will aim to support the infrastructure of Harmony and its core DAOs to empower them to focus even more on achieving their mission.\\n\\n*Matty McDonald of the Harmony core team will assist BasicDAO as a liaison / team lead, providing the signatories with assistance and guidance as necessary.*", "admins": [], "avatar": "ipfs://QmazPLitnQJmWgaq6UDC94Ze4dXSNcfvR6xCxJALSRA7K3", "creator": "0x470579d16401a36BF63b1428eaA7189FBdE5Fee9", "members": [], "mission": "The official operations partner for Harmony Core DAOs", "network": "mainnet", "blockchain": "ONE", "categories": ["social", "service"], "validation": {"name": "basic", "params": {}}}', 0, 1650880058, '0x470579d16401a36BF63b1428eaA7189FBdE5Fee9', 1650880058, 'As operations scale to support the initiatives of Harmony’s Core Team and Core DAOs, the need for a high-quality, diverse, and well-rounded team of contributors is paramount to the success of our ecosystem.
