ints, and incentives over time as needed. The protocol is light enough for a group of friends, yet powerful enough for a global network of anons sharing thousands of ETH.', 'ipfs://QmdjSsefAynNhLPVJxT8CsU9Ksp2fmozy71HVAE1c7REKo', '["0xf7253A0E87E39d2cD6365919D4a3D56D431D0041", "0x34724D71cE674FcD4d06e60Dd1BaA88c14D36b75"]', '["protocol"]', 'jbx-protocol', '[]', 'Help people confidently run programmable and community funded treasuries from startup to scale', '1', null, 'juiceboxETH', 'ETH', 'juicebox', null, null, null, null, null, null, null, null, null, '[]', null);
