insert into dodao.spaces (id, settings, verified, created_at, creator, updated_at, about, avatar, admins, categories, github, members, mission, network, terms, twitter, blockchain, skin, discord_invite, guides_page_footer_content, guides_page_header_content, guides_bundle_page_footer_content, guides_bundle_page_header_content, blog_site, public_forum_website, reference_docs_website, telegram_invite, features, invite_links) values ('molochdao-eth-1', '{"name": "? MolochDAO ?", "about": "Moloch is the name given to problems associated with collective action, where individual incentives are misaligned with globally optimal outcomes. These are the problems that have existed throughout human history under different guises but yet have remained largely unsolved.\\n   \\nMolochDAO strives to address these issues.\\n   \\nMolochDAO is a Decentralized Autonomous Organization, deployed on Ethereum mainnet. Members contribute capital with the sole intention of giving it all away to fund Ethereum infrastructure as an essential digital public good.\\n\\nMoloch DAO was deployed on Ethereum main on Feb 14’ 2019. Since its inception Moloch has awarded $700,000 in grants.", "admins": [], "avatar": "ipfs://QmXbMfy7Yq3uvf7Zo6SqGyiKJPaAhUD3q1fCSsS29rgteA", "creator": "0x8Eeee1781fD885ff5DdeF7789486676961873D12", "members": [], "mission": "The Original Grant Giving DAO", "network": "1", "blockchain": "ETH", "categories": ["social", "grant"], "validation": {"name": "basic", "params": {}}}', 0, 1646558604, '0x8Eeee1781fD885ff5DdeF7789486676961873D12', 1646558604, 'Moloch is the name given to problems associated with collective action, where individual incentives are misaligned with globally optimal outcomes. These are the problems that have existed throughout human history under different guises but yet have remained largely unsolved.
