insert into dodao.spaces (id, settings, verified, created_at, creator, updated_at, about, avatar, admins, categories, github, members, mission, network, terms, twitter, blockchain, skin, discord_invite, guides_page_footer_content, guides_page_header_content, guides_bundle_page_footer_content, guides_bundle_page_header_content, blog_site, public_forum_website, reference_docs_website, telegram_invite, features, invite_links) values ('nearweek-dao-near-mainnet', '{"name": "NEARWEEK DAO", "about": "NEARWEEK is a community run NEAR ecosystem oriented media outlet and SoMe amplification platform. Through that, NEARWEEK is a foundational stepping stone on the path towards decentralization. We are on a mission to accommodate decentralisation by providing marketing support and gathering all valid NEAR information in one place while building out a scalable setup for curation, NEAR content production and dispersion. Initiatives that all seek to increase awareness and the number of weekly active users on the NEAR Protocol blockchain.\\n\\nWe''re always looking for:\\n- Content producers (written, infographics, video, audio) \\n- News curators with a thorough understanding of the NEAR Ecosystem.\\n\\nPlease don''t hesitate to reach out at news@nearweek.com if you want to know more about our project.", "terms": "https://nearweek.com", "admins": ["0x9904BD1f49307394C8f7720D59E09257e564a137"], "avatar": "ipfs://QmPqYrcw3nBR637kFECNE3N4Ajhy7ER6wqMrj1yq8WbsjF", "creator": "p3ter.near", "members": [], "mission": "NEARWEEK is a community run NEAR ecosystem oriented media outlet", "network": "mainnet", "twitter": "nearweek", "blockchain": "NEAR", "categories": ["media", "service"], "validation": {"name": "basic", "params": {}}}', 0, 1648713698, 'p3ter.near', 1648713698, 'NEARWEEK is a community run NEAR ecosystem oriented media outlet and SoMe amplification platform. Through that, NEARWEEK is a foundational stepping stone on the path towards decentralization. We are on a mission to accommodate decentralisation by providing marketing support and gathering all valid NEAR information in one place while building out a scalable setup for curation, NEAR content production and dispersion. Initiatives that all seek to increase awareness and the number of weekly active users on the NEAR Protocol blockchain.
insert into dodao.spaces (id, settings, verified, created_at, creator, updated_at, about, avatar, admins, categories, github, members, mission, network, terms, twitter, blockchain, skin, discord_invite, guides_page_footer_content, guides_page_header_content, guides_bundle_page_footer_content, guides_bundle_page_header_content, blog_site, public_forum_website, reference_docs_website, telegram_invite, features, invite_links) values ('nil-dao-eth-1', '{"name": "Nil DAO", "about": "NIL, a community based NFT marketplace is structured to give people the opportunity to truly own NFTs in the creator economy. Basically, creators, curators and collectors can work together from a decentralized platform to build, support and own NFTs.\\n\\nThe vision for Nil DAO is to create a foundation upon which the creator economy will thrive. With Nil DAO, artists can now easily have intellectual property rights on their creation without any form of disputes. Creator economy participants make the Nil DAO platform functional and exciting. These participants are divided into three (3) namely:\\n- Creators\\n- Curators\\n- Collectors\\n\\nThe creators are artists who place their work on Nil DAO. Curators are members who hold $NIL (Governance token) and pledge support for any artist of their choice while collectors are people who buy the work on Nil.", "admins": [], "avatar": "ipfs://QmbEQeWLq5pC5nx8aYGBc9gNmu4uSLm1hqV3gekFaTqnWR", "creator": "0x470579d16401a36BF63b1428eaA7189FBdE5Fee9", "members": [], "mission": "Marketplace looking to harmonize the relationship between the creator economy participants", "network": "1", "twitter": "Nil__dao", "blockchain": "ETH", "categories": ["protocol", "creator"], "validation": {"name": "basic", "params": {}}}', 0, 1647366764, '0x470579d16401a36BF63b1428eaA7189FBdE5Fee9', 1647366764, 'NIL, a community based NFT marketplace is structured to give people the opportunity to truly own NFTs in the creator economy. Basically, creators, curators and collectors can work together from a decentralized platform to build, support and own NFTs.
