insert into dodao.spaces (id, settings, verified, created_at, creator, updated_at, about, avatar, admins, categories, github, members, mission, network, terms, twitter, blockchain, skin, discord_invite, guides_page_footer_content, guides_page_header_content, guides_bundle_page_footer_content, guides_bundle_page_header_content, blog_site, public_forum_website, reference_docs_website, telegram_invite, features, invite_links) values ('tracer-dao-eth-1', '{"name": "Tracer DAO", "about": "At its core, Tracer is an open source derivative infrastructure based on smart contracts that permits individuals to control risk. Tracer is the impetus behind the derivative trading industry.\\n\\nA significant challenge in the decentralized finance sphere involves the reduction of different tokens'' elevated risks that they might develop. By employing derivatives like Tracer, these threats can be lowered.\\n\\nOne of the very first products of Tracer DAO is Perpetual Pools. Perpetual pools are a simple and secure way to create granular tokens that won''t expire, don''t need to be traded in full and can''t be liquidated. Any perpetual pool to be created is not dictated by Governance and Voting granting the users the ability to address a wide arena of assets. The flexibility and dynamicity offered by Tracer is immense as anyone can initiate a marketplace at any point of time and provide liquidity for the market created.\\n\\nHere is what Tracer offers!\\n\\n1. Unique Derivative products\\n2. Factory contracts allowing creation of any type of market\\n3. Provides governance for factory/template contracts\\n4. Helps in stabilizing the volatile markets\\n5. Assists in effective risk management\\n6. Makes the expensive products accessible to the common market\\n7. Decentralized, secure, transparent, democratic and trusted financial ecosystem.", "admins": [], "avatar": "ipfs://QmbqKS7vTVG1K9BfJoVWSdU2Bdd3RHMAMhkdtC2KPunEvN", "creator": "0x470579d16401a36BF63b1428eaA7189FBdE5Fee9", "members": [], "mission": "Provide infrastructure based on smart contracts that permits individuals to control risk", "network": "1", "twitter": "TracerDAO", "blockchain": "ETH", "categories": ["protocol"], "validation": {"name": "basic", "params": {}}}', 0, 1647212137, '0x470579d16401a36BF63b1428eaA7189FBdE5Fee9', 1647212137, 'At its core, Tracer is an open source derivative infrastructure based on smart contracts that permits individuals to control risk. Tracer is the impetus behind the derivative trading industry.
